import React from 'react';
import './App.css';
import {link} from 'react-router-dom'

function Nav() {
  return (
    <nav><h3>Seasons</h3>
    <ul className="navlinks">
     <link to ='/Spring'><li>Spring</li></link> 
     <link to ='/Summer'><li>Summer</li></link> 
     <link to ='/Fall'><li>Fall</li></link> 
    </ul>
    </nav>
  );
}

export default Nav;
